9793f40e-eb0a-4d56-a8c3-a1af98479865	2024-12-09 04:06:12.869+00	2024-12-09 04:06:54.499+00	// SPDX-License-Identifier: MIT\npragma solidity >=0.7.0 <0.9.0;\n\ncontract TransactionManager {\n  struct Transaction {\n    string transaction_code;\n    uint256 amount;\n    string direction;\n    uint256 datetime;\n  }\n\n  Transaction[] public transactions;\n\n  function createTransactions(\n    Transaction[] memory _transactions\n  ) public {\n    for (uint i = 0; i < _transactions.length; i++) {\n      transactions.push(\n        Transaction({\n          transaction_code: _transactions[i].transaction_code,\n          amount: _transactions[i].amount,\n          direction: _transactions[i].direction,\n          datetime: block.timestamp\n        })\n      );\n    }\n  }\n\n  function getAllTransactions() public view returns (string[] memory, uint256[] memory, string[] memory, uint256[] memory) {\n    uint256 length = transactions.length;\n    \n    string[] memory transactionCodes = new string[](length);\n    uint256[] memory amounts = new uint256[](length);\n    string[] memory directions = new string[](length);\n    uint256[] memory datetimes = new uint256[](length);\n\n    for (uint i = 0; i < length; i++) {\n      transactionCodes[i] = transactions[i].transaction_code;\n      amounts[i] = transactions[i].amount;\n      directions[i] = transactions[i].direction;\n      datetimes[i] = transactions[i].datetime;\n    }\n\n    return (transactionCodes, amounts, directions, datetimes);\n  }\n}\n	[{"inputs":[{"components":[{"internalType":"string","name":"transaction_code","type":"string"},{"internalType":"uint256","name":"amount","type":"uint256"},{"internalType":"string","name":"direction","type":"string"},{"internalType":"uint256","name":"datetime","type":"uint256"}],"internalType":"struct TransactionManager.Transaction[]","name":"_transactions","type":"tuple[]"}],"name":"createTransactions","outputs":[],"stateMutability":"nonpayable","type":"function"},{"inputs":[],"name":"getAllTransactions","outputs":[{"internalType":"string[]","name":"","type":"string[]"},{"internalType":"uint256[]","name":"","type":"uint256[]"},{"internalType":"string[]","name":"","type":"string[]"},{"internalType":"uint256[]","name":"","type":"uint256[]"}],"stateMutability":"view","type":"function"},{"inputs":[{"internalType":"uint256","name":"","type":"uint256"}],"name":"transactions","outputs":[{"internalType":"string","name":"transaction_code","type":"string"},{"internalType":"uint256","name":"amount","type":"uint256"},{"internalType":"string","name":"direction","type":"string"},{"internalType":"uint256","name":"datetime","type":"uint256"}],"stateMutability":"view","type":"function"}]		0xD3aA556287Afe63102e5797BFDDd2A1E8DbB3eA5
